// components
import AnimOnView from "../anim/AnimOnView.js"
import Project from "./Project.js"

import forAllTnIcon from "../../media/f-a-tn-icon.jpg"

const Projects = (props) => {

    return (
        <div className='Projects full-screen align-center'>
            <AnimOnView>
                <h2 className='align-center'> My Work </h2>
                <div className='projects-container'>
                    <Project icon={forAllTnIcon} title='For All TN' descr='hello' ghLink='' link='foralltn.org' />
                </div>

            </AnimOnView>
        </div>
    );
} 

export default Projects;
